//         function(returnedData){
//    console.log(returnedData);
//  });

}

function App() {
  return (
    <div className="App">
      <p>Let's see if we can't generate and display an image...</p>
      <button onClick={() => handleClick() }>Generate image</button>
    </div>
  );
}

export default App;
